import React from 'react';
import '../index.css';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Header() {
	return (
		<header>
			<Navbar bg='dark' variant='dark' expand='lg' collapseOnSelect>
				<Container fluid>
					<Navbar.Brand className="hover:text-amber-400 hover:font-bold" href='/'>PikeShop</Navbar.Brand>
					<Navbar.Toggle aria-controls='navbarScroll' />
					<Navbar.Collapse id='navbarScroll'>
						<Nav
							className='my-2 my-lg-0 ms-auto'
							style={{ minHeight: '100px' }}
							navbarScroll>
							<Nav.Link className="hover:text-amber-400" href='/cart'><i class="fa-solid fa-cart-shopping"></i> Koszyk</Nav.Link>
							<Nav.Link className="hover:text-amber-400" href='/login'><i class="fa-solid fa-right-to-bracket"></i> Logowanie</Nav.Link>
						</Nav>
					</Navbar.Collapse>
				</Container>
			</Navbar>
		</header>
	);
}

export default Header;
